    console.log(data);
    alert("Register Successfully...!!!");
  // window.location.href="/login";
  // })

}
}
export function emailRgex(control:AbstractControl) {
  let testEmail = "^[A-Za-z0-9+_.-]+@$";
  if(control.value && control.value.match(testEmail)) {
    return null;
  }else{
    return {myError:false}
  }
}
